  \"2016-11-25T21:06:44.962509\",\n\t\"name\": \"digital-government-strategy-report\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"On May 23, 2012, the President issued a
  Presidential Memorandum on u201cBuilding a 21st Century Digital Governmentu201d.
  It launched a comprehensive Digital Government Strategy (pdf/html5) aimed at delivering
  better digital services to the American people. The strategy builds on several initiatives,
  including Executive Order 13571, Streamlining Service Delivery and Improving Customer
  Service, and Executive Order 13576, Delivering an Efficient, Effective, and Accountable
  Government. The strategy lays out actions in a 12-month roadmap and has three main
  objectives: (1) Enable the American people and an increasingly mobile workforce
  to access high-quality digital government information and services anywhere, anytime,
  on any device. (2) Ensure that as the government adjusts to this new digital world,
  we seize the opportunity to procure and manage devices, applications, and data in
  smart, secure and affordable ways. (3) Unlock the power of government data to spur
  innovation across our Nation and improve the quality of services for the American
  people.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\": [{\n\t\t\"key\":
